amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;An OS is&amp;lt;b&amp;gt;&amp;amp;nbsp;&amp;lt;/b&amp;gt;software that:&amp;lt;/font&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;Manages computer hardware and resources&amp;lt;/font&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;Allows interaction with hardware to perform useful tasks&amp;lt;/font&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;glass=0;shadow=1;fillColor=#dae8fc;strokeColor=#6c8ebf;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;140\&quot; y=\&quot;150\&quot; width=\&quot;369\&quot; height=\&quot;200\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-21\&quot; style=\&quot;edgeStyle=orthogonalEdgeStyle;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;strokeWidth=2;flowAnimation=1;\&quot; edge=\&quot;1\&quot; parent=\&quot;1\&quot; source=\&quot;5Yjh7000t9OMH309bSvo-2\&quot; target=\&quot;5Yjh7000t9OMH309bSvo-20\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-2\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;text-align: center; margin-top: 0px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;Unix&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/h1&amp;gt;&amp;lt;div&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;Unix is a familiy of OSs&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;Popular Unix-based OSs include:&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;Oracle Solaris (and Open Solaris&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;FreeBSD&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;HP-UX&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;IBM AIX&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Apple macOS&amp;lt;/b&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;fillColor=#d5e8d4;strokeColor=#82b366;shadow=1;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;624\&quot; y=\&quot;150\&quot; width=\&quot;356\&quot; height=\&quot;200\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-4\&quot; value=\&quot;&amp;lt;font style=&amp;quot;font-size: 48px;&amp;quot;&amp;gt;Introducing Linux and Unix&amp;lt;/font&amp;gt;\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fillColor=#f5f5f5;fontColor=#333333;strokeColor=#666666;shadow=1;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;120\&quot; y=\&quot;60\&quot; width=\&quot;880\&quot; height=\&quot;80\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-18\&quot; value=\&quot;\&quot; style=\&quot;edgeStyle=orthogonalEdgeStyle;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;flowAnimation=1;strokeWidth=2;\&quot; edge=\&quot;1\&quot; parent=\&quot;1\&quot; source=\&quot;5Yjh7000t9OMH309bSvo-11\&quot; target=\&quot;5Yjh7000t9OMH309bSvo-17\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-11\&quot; value=\&quot;&amp;lt;font style=&amp;quot;font-size: 18px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;1960s&amp;lt;/b&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;div&amp;gt;&amp;lt;b&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/b&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;b&amp;gt;Original Unix OS created&amp;lt;/b&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;shape=step;perimeter=stepPerimeter;whiteSpace=wrap;html=1;fixedSize=1;fillColor=#d5e8d4;strokeColor=#82b366;shadow=1;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;226\&quot; y=\&quot;450\&quot; width=\&quot;187\&quot; height=\&quot;130\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-16\&quot; value=\&quot;The original Unix OS was created at AT&amp;amp;amp;T Bell Labs. However, like many operating systems at the time, it was made for a specific hardware system, in this case, the PDP-7 computer\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;216\&quot; y=\&quot;593\&quot; width=\&quot;207\&quot; height=\&quot;75\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-23\&quot; value=\&quot;\&quot; style=\&quot;edgeStyle=orthogonalEdgeStyle;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;flowAnimation=1;strokeWidth=2;\&quot; edge=\&quot;1\&quot; parent=\&quot;1\&quot; source=\&quot;5Yjh7000t9OMH309bSvo-17\&quot; target=\&quot;5Yjh7000t9OMH309bSvo-22\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-17\&quot; value=\&quot;&amp;lt;font style=&amp;quot;font-size: 18px;&amp;quot;&amp;gt;&amp;lt;span&amp;gt;1970s&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;div&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;Unix rewritten in C&amp;lt;/div&amp;gt;\&quot; style=\&quot;shape=step;perimeter=stepPerimeter;whiteSpace=wrap;html=1;fixedSize=1;fillColor=#d5e8d4;strokeColor=#82b366;shadow=1;fontStyle=1\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;493\&quot; y=\&quot;450\&quot; width=\&quot;187\&quot; height=\&quot;130\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-19\&quot; value=\&quot;The Unix OS was rewritten in C [Programming Language], distinguishing itself from other systems and making it portable to many hardware architectures\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;493\&quot; y=\&quot;587\&quot; width=\&quot;180\&quot; height=\&quot;87\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-20\&quot; value=\&quot;&amp;lt;font style=&amp;quot;font-size: 24px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Unix beginnings&amp;lt;/b&amp;gt;&amp;lt;/font&amp;gt;\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;fillColor=#d5e8d4;strokeColor=#82b366;shadow=1;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;226\&quot; y=\&quot;400\&quot; width=\&quot;730.5\&quot; height=\&quot;30\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-22\&quot; value=\&quot;&amp;lt;font style=&amp;quot;font-size: 18px;&amp;quot;&amp;gt;&amp;lt;span&amp;gt;Late 1970s&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;div&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;BSD developed&amp;lt;/div&amp;gt;\&quot; style=\&quot;shape=step;perimeter=stepPerimeter;whiteSpace=wrap;html=1;fixedSize=1;fillColor=#d5e8d4;strokeColor=#82b366;shadow=1;fontStyle=1\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;760\&quot; y=\&quot;450\&quot; width=\&quot;187\&quot; height=\&quot;130\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-24\&quot; value=\&quot;UC Berkley developed Berkley Software Distribution (or BSD), an add-on to Unix providing additional software and capabilities. The famous macOS was later derived from BSD\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;760\&quot; y=\&quot;593\&quot; width=\&quot;180\&quot; height=\&quot;87\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-45\&quot; style=\&quot;edgeStyle=orthogonalEdgeStyle;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;entryX=0.5;entryY=0;entryDx=0;entryDy=0;strokeWidth=2;flowAnimation=1;\&quot; edge=\&quot;1\&quot; parent=\&quot;1\&quot; source=\&quot;5Yjh7000t9OMH309bSvo-25\&quot; target=\&quot;5Yjh7000t9OMH309bSvo-38\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-25\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;text-align: center; margin-top: 0px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;Linux&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/h1&amp;gt;&amp;lt;div&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;Linux is a family of Unix-like OSs&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;Linux was originally developed as an effort to create a free, &amp;lt;b&amp;gt;open source&amp;lt;/b&amp;gt; Unix OS&amp;lt;span style=&amp;quot;white-space: pre;&amp;quot;&amp;gt;&amp;#x9;&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;fillColor=#f8cecc;strokeColor=#b85450;shadow=1;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;140\&quot; y=\&quot;700\&quot; width=\&quot;359\&quot; height=\&quot;200\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-29\&quot; style=\&quot;edgeStyle=orthogonalEdgeStyle;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;entryX=0.068;entryY=-0.002;entryDx=0;entryDy=0;entryPerimeter=0;exitX=0.068;exitY=1.02;exitDx=0;exitDy=0;exitPerimeter=0;shape=link;flowAnimation=1;strokeWidth=3;\&quot; edge=\&quot;1\&quot; parent=\&quot;1\&quot; source=\&quot;5Yjh7000t9OMH309bSvo-1\&quot; target=\&quot;5Yjh7000t9OMH309bSvo-25\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-31\&quot; value=\&quot;&amp;lt;h1 style=&amp;quot;text-align: center; margin-top: 0px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;Linux features&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/h1&amp;gt;&amp;lt;div&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Free and open source:&amp;lt;/b&amp;gt;&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;font-size: 12px;&amp;quot;&amp;gt;anyone can view the source code&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Secure:&amp;lt;/b&amp;gt;&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;font-size: 12px;&amp;quot;&amp;gt;Linux has become the most secure OS over the years&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Multi-user:&amp;lt;/b&amp;gt;&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;font-size: 12px;&amp;quot;&amp;gt;Linux is designed to support multiple users accessing the system simultaneously&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Multitasking:&amp;lt;/b&amp;gt;&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;font-size: 12px;&amp;quot;&amp;gt;It supports running multiple jobs and applications at the same time&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;&amp;lt;font size=&amp;quot;3&amp;quot;&amp;gt;&amp;lt;b&amp;gt;Portability:&amp;lt;/b&amp;gt;&amp;amp;nbsp;&amp;lt;/font&amp;gt;&amp;lt;font style=&amp;quot;font-size: 12px;&amp;quot;&amp;gt;Linux has been ported to run on many different types of devices and hardware platforms from desktops to servers to appliances&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;fillColor=#f8cecc;strokeColor=#b85450;shadow=1;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;506\&quot; y=\&quot;700\&quot; width=\&quot;450\&quot; height=\&quot;200\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-32\&quot; value=\&quot;\&quot; style=\&quot;edgeStyle=orthogonalEdgeStyle;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;flowAnimation=1;strokeWidth=2;\&quot; edge=\&quot;1\&quot; parent=\&quot;1\&quot; source=\&quot;5Yjh7000t9OMH309bSvo-33\&quot; target=\&quot;5Yjh7000t9OMH309bSvo-36\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-33\&quot; value=\&quot;&amp;lt;font style=&amp;quot;font-size: 18px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;1980s&amp;lt;/b&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;div&amp;gt;&amp;lt;b&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/b&amp;gt;&amp;lt;/div&amp;gt;&amp;lt;div&amp;gt;&amp;lt;b&amp;gt;GNU developed&amp;lt;/b&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;shape=step;perimeter=stepPerimeter;whiteSpace=wrap;html=1;fixedSize=1;fillColor=#f8cecc;strokeColor=#b85450;shadow=1;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;147\&quot; y=\&quot;1000\&quot; width=\&quot;187\&quot; height=\&quot;130\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-34\&quot; value=\&quot;In the 1980s, GNU was developed at MIT. GNU stands for “GNU’s not Unix” and was made as a free, open source set of the existing Unix system tools\&quot; style=\&quot;text;html=1;align=center;verticalAlign=middle;whiteSpace=wrap;rounded=0;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;137\&quot; y=\&quot;1143\&quot; width=\&quot;207\&quot; height=\&quot;75\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-35\&quot; value=\&quot;\&quot; style=\&quot;edgeStyle=orthogonalEdgeStyle;rounded=0;orthogonalLoop=1;jettySize=auto;html=1;flowAnimation=1;strokeWidth=2;\&quot; edge=\&quot;1\&quot; parent=\&quot;1\&quot; source=\&quot;5Yjh7000t9OMH309bSvo-36\&quot; target=\&quot;5Yjh7000t9OMH309bSvo-39\&quot;&gt;\n          &lt;mxGeometry relative=\&quot;1\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-36\&quot; value=\&quot;&amp;lt;span style=&amp;quot;font-size: 18px;&amp;quot;&amp;gt;1991&amp;l ions of servers running all kinds of applications, web servers, databases, and so on&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;li style=&amp;quot;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 16px;&amp;quot;&amp;gt;&amp;lt;b&amp;gt;PCs:&amp;lt;/b&amp;gt;&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;font style=&amp;quot;font-size: 12px;&amp;quot;&amp;gt;versions of Linux can be easily used as your PC’s operating system. Many people install Linux today as a learning experience or as their daily driver&amp;lt;/font&amp;gt;&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;html=1;whiteSpace=wrap;overflow=hidden;rounded=0;fillColor=#f8cecc;strokeColor=#b85450;shadow=1;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;140\&quot; y=\&quot;1490\&quot; width=\&quot;810\&quot; height=\&quot;180\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-51\&quot; value=\&quot;Juan Camilo Jaramillo Tascón&amp;lt;br&amp;gt;@juancjaramillot\&quot; style=\&quot;rounded=1;whiteSpace=wrap;html=1;hachureGap=4;fontFamily=Tahoma;fontSize=13;fillColor=#f5f5f5;strokeColor=#666666;fontStyle=1;fontColor=#333333;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;769\&quot; y=\&quot;3.7199999999999998\&quot; width=\&quot;325\&quot; height=\&quot;49\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;5Yjh7000t9OMH309bSvo-52\&quot; value=\&quot;\&quot; style=\&quot;dashed=0;outlineConnect=0;html=1;align=center;labelPosition=center;verticalLabelPosition=bottom;verticalAlign=top;shape=mxgraph.webicons.linkedin;fillColor=#0095DB;gradientColor=#006391;hachureGap=4;fontFamily=Architects Daughter;fontSource=https%3A%2F%2Ffonts.googleapis.com%2Fcss%3Ffamily%3DArchitects%2BDaughter;fontSize=20;\&quot; vertex=\&quot;1\&quot; parent=\&quot;1\&quot;&gt;\n          &lt;mxGeometry
